class Solution {
    fun maximumStrongPairXor(nums: IntArray): Int {
        var max = 0
        for (i in nums.indices) {
            for (j in i until nums.size) {
                if (Math.abs(nums[i] - nums[j]) <= Math.min(nums[i], nums[j])) {
                    max = Math.max(max, nums[i] xor nums[j])
                }
            }
        }
        return max
    }
}
